import React from 'react';
import { Link } from 'react-router-dom';
import './Volunteer.css';

const Volunteer = () => {
  const contacts = [
    {
      name: 'Volunteer 1',
      logo: 'volunteer-logo-1.png',
      description: 'Description for volunteer 1.',
      url: 'https://volunteer-1.com',
    },
    {
      name: 'Volunteer 2',
      logo: 'volunteer-logo-2.png',
      description: 'Description for volunteer 2.',
      url: 'https://volunteer-2.com',
    },
    // 其他联系人...
  ];

  return (
    <div className="contact-subpage">
      <h1>Volunteer</h1>
      <ul className="contact-list">
        {contacts.map((contact, index) => (
          <li key={index} className="contact-item">
            <img src={contact.logo} alt={`${contact.name} logo`} className="contact-logo" />
            <div className="contact-info">
              <h2>{contact.name}</h2>
              <p>{contact.description}</p>
              <a href={contact.url} target="_blank" rel="noopener noreferrer">Visit Website</a>
            </div>
          </li>
        ))}
      </ul>
      <Link to="/Contact" className="back-button">Back to Contact</Link>
    </div>
  );
};

export default Volunteer;
